const map=document.getElementById("map"),frabl=map.getAttribute("data-frabl");function initMap(o){const e=52.370216,n=4.895168,t=L.map("map").setView([e,n],11);L.tileLayer("https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png",{attribution:'&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors',maxZoom:13,minZoom:11}).addTo(t),console.log(o),o.locations.location.forEach(o=>{"true"===o.available?L.marker([o.holding.latitude,o.holding.longitude],{icon:icon("green")}).addTo(t).bindPopup(`Beschikbaar in: ${o.name}`):L.marker([o.holding.latitude,o.holding.longitude],{icon:icon("red")}).addTo(t).bindPopup("Something")})}function icon(o){return L.icon({iconUrl:`../images/marker-${o}.png`,iconSize:[38,60],iconAnchor:[22,59],popupAnchor:[-3,-76]})}fetch(`/markers/${frabl}`).then(o=>o.json()).then(o=>{o.error?console.error(o.error):initMap(o)}).catch(o=>console.error(o));